import React, { useState, useEffect } from 'react';
import '../styles/pages/HomeStyle.css';
import Navbar from '../components/Navbar';
import MyGoogleMap from '../components/GoogleMap';

function HomePage() {
    const token = localStorage.getItem('authToken');
    const userId = localStorage.getItem('userId');
    const [bookmarks, setBookmarks] = useState([]);

    useEffect(() => {
        const fetchUserBookmarks = async () => {
            try {
                const response = await fetch(`http://localhost:3000/api/auth/bookmarks/${userId}`, {
                    method: 'GET',
                    headers: {
                        Authorization: token,
                    },
                });

                if (response.status === 200) {
                    const data = await response.json();
                    setBookmarks(data); // Update the state with the fetched bookmarks
                } else {
                    console.error('Error fetching bookmarks');
                }
            } catch (error) {
                console.error('Error:', error);
            }
        };

        fetchUserBookmarks(); // Fetch user bookmarks when the component mounts
    }, [token, userId]);

    return (
        <div className="home-container">
            <Navbar className="navbar" />

            {/* Separate div for the map */}
            {/*<div className="map-container">*/}
            {/*    <MyGoogleMap bookmarks={bookmarks} />*/}
            {/*</div>*/}
        </div>
    );
}

export default HomePage;
